* {
	box-sizing: border-box;
  }

  html {
	font-family: "Fira Sans", sans-serif;
	font-size: 16px;
	font-weight: normal;
	line-height: 1.5;
	scroll-behavior: smooth;
  }

    ul,
    li,
    button,
    input,
    textarea,
    span,
    p {
      margin: 0;
      padding: 0;
      outline: none;
    }

  body {
    max-width: 1360px;
    margin-left: auto;
    margin-right: auto;
    background-color: #E5E5E5;
  }

  .container {
    position: relative;
    overflow: hidden;

    @media (min-width: 1360px) {
      box-shadow: 0 0 65px 0 rgba(0,0,0,0.2);
      margin: 0 auto;
    }

    @media (max-width: 768px) {
      overflow-y: visible;
    }
  }

    h1,
    h2,
    h3,
    h4 {
      margin: 0;
    }

  h1 {
	font-family: Fira Sans;
	font-size: 80px;
	font-style: normal;
	font-weight: 700;
	line-height: 70px;
	letter-spacing: -1px;
	text-align: left;
	height: 140px;
    width: 474px;
    left: 126px;
    top: 232px;
    border-radius: nullpx;
  }

a {
	text-decoration: none;
  }

  button:focus,
  input:focus {
	outline: none;
  }

