.header__label {
  z-index: 4;
  width: 60px;
  height: 29px;
  margin-top: -29px;
  cursor: pointer;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url("./images/Menu.svg");
  display: block;
}


 .header__toggler {
  display: none;
  z-index: 4;

   &:checked + .header__label {
    background-image: url("./images/cross.png");
    z-index: 4;
  }

   &:checked ~ .burger {
    right: 0;
  }
}

