.link {
 display: inline-block;
 // font-size: 14px;
 line-height: 100%;
 position: relative;
 margin-bottom: 50px;
 cursor: pointer;

  &::after {
   display: block;
   position: absolute;
   left: 0;
   width: 0;
   height: 3px;
   background-color: white;
   content: "";
   transition: width 0.4s ease-out;
   bottom: -12px;
 }

  &:hover:after {
   width: 318px;
 }
}
